Этот каталог представляет собой кэш реализации. В соответствии с разрешениями файловой системы файлы доступны только для чтения, поэтому их нельзя удалить, как обычно.

Если нужно удалить отдельную реализацию, используйте следующую команду:
{0}

Если нужно удалить весь каталог, используйте следующую команду:
{1}

Если нужно удалить весь каталог без использования Zero Install, используйте следующую команду:
{2}
